    "2016-07-27T22:18:40.573349",nt"name": "wetlands-inventory-nevada",nt"isopen":
    false,nt"url": null,nt"notes": "The Nevada wetlands inventory is a unit
    of a nationwide survey undertaken by the Fish and Wildlife Service to locate and
    tabulate by habitat types the important wetland areas of each State and to estimate
    their current value for waterfowl. Such an inventory is essential to determine the
    quality and extent of remaining wetlands upon which future waterfowl-flyway management
    plans by State and Federal conservation agencies must be based. This basic information
    should also be of value to public and private agencies alike that  are concerned
    with the planning of agricultural land-use programs and multiple-purpose projects.
    A knowledge of existing wildlife values is necessary for adequate consideration
    of wildlife requirements in future development programs. Many of the remaining wetlands
    are essential if a proper balance between such a renewable natural resource as wildlife
    and other resources is to be maintained. The future of aquatic wildlife will depend
    entirely on the consideration given it in basic planning for land utilization.",nt"license_title":
